import React from "react";
import LiveCam from "./components/LiveCam";
import RegisterFace from "./components/RegisterFace";

const App = () => {
  return (
    <div className="p-8">
      <h1 className="text-2xl font-bold mb-6">Face Recognition Platform</h1>
      <RegisterFace />
      <div className="mt-10">
        <LiveCam />
      </div>
    </div>
  );
};

export default App;
